package com.zhzx.dao.bean.order;import com.zhzx.dao.bean.BaseBean;public class Cart extends BaseBean {		/**	*	*/	private String id;		/**	*客户编号	*/	private String custNo;		/**	*订单编号	*/	private String orderNo;		/**	*商品编号	*/	private String prodNo;		/**	*数量	*/	private Integer num;			public String getId() {	    return this.id;	}	public void setId(String id) {	    this.id=id;	}	public String getCustNo() {	    return this.custNo;	}	public void setCustNo(String custNo) {	    this.custNo=custNo;	}	public String getOrderNo() {	    return this.orderNo;	}	public void setOrderNo(String orderNo) {	    this.orderNo=orderNo;	}	public String getProdNo() {	    return this.prodNo;	}	public void setProdNo(String prodNo) {	    this.prodNo=prodNo;	}	public Integer getNum() {	    return this.num;	}	public void setNum(Integer num) {	    this.num=num;	}}